import "./index.css"
import TopButton from "./components/TopButton"

const Home = () => {
    return (
        <div className="app">
            <NavigationBar></NavigationBar>
        </div>
    )
}

const NavigationBar = () => {
    return (
        <div>
            <TopButton> ITZY </TopButton>
        </div>
    );
}


export default Home
